import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import { logo, background } from "../Assets/index";

const Register = () => {
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [role, setRole] = useState("");
  const [password, setPassword] = useState("");

  const [emailError, setEmailError] = useState("");
  const [message, setMessage] = useState(null);
  const [messageType, setMessageType] = useState("success");

  const navigate = useNavigate();

  useEffect(() => {
    const timeoutId = setTimeout(() => {
      if (email) {
        checkEmailExists(email);
      }
    }, 500);
    return () => clearTimeout(timeoutId);
  }, [email]);

  const checkEmailExists = async (emailToCheck) => {
    try {
      const response = await fetch(
        `http://localhost:5000/api/check-email?email=${emailToCheck}`
      );
      const data = await response.json();
      if (data.exists) {
        setEmailError("Email Ä‘Ã£ tá»“n táº¡i!");
      } else {
        setEmailError("");
      }
    } catch (err) {
      /* eslint-disable */console.error(...oo_tx(`2631044150_38_6_38_51_11`,"Lá»—i khi kiá»ƒm tra email:", err));
    }
  };

  const registerUser = async (event) => {
    event.preventDefault();

    if (!name || !email || !role || !password) {
      setMessage("â— Vui lÃ²ng Ä‘iá»n Ä‘áº§y Ä‘á»§ thÃ´ng tin!");
      setMessageType("error");
      return;
    }

    if (emailError) return;

    try {
      const response = await fetch("http://localhost:5000/api/register", {
        method: "POST",
        headers: {
          "Content-type": "application/json",
        },
        body: JSON.stringify({
          name,
          email,
          role,
          password,
        }),
      });

      const data = await response.json();

      if (response.ok) {
        setMessage("ðŸŽ‰ ÄÄƒng kÃ½ thÃ nh cÃ´ng!");
        setMessageType("success");
        setTimeout(() => navigate("/"), 1500);
      } else {
        setMessage(data.message || "âŒ ÄÄƒng kÃ½ tháº¥t báº¡i!");
        setMessageType("error");
      }
    } catch (error) {
      setMessage("âŒ Lá»—i káº¿t ná»‘i Ä‘áº¿n server!");
      setMessageType("error");
    }

    setTimeout(() => {
      setMessage(null);
    }, 3000);
  };

  return (
    <div
      className="flex items-center justify-center h-screen"
      style={{
        backgroundImage: `url(${background})`,
        backgroundSize: "cover",
      }}
    >
      <div className="bg-white p-10 rounded-xl shadow-xl w-full max-w-md">
        <div className="text-center mb-5">
          <img
            className="w-48 h-auto mx-auto mb-6"
            src={logo}
            alt="logo"
          />
          <h1 className="text-3xl font-bold text-gray-700 mb-2">ÄÄƒng kÃ½</h1>
          <p className="text-gray-500">
            ÄÃ£ cÃ³ tÃ i khoáº£n?{" "}
            <span
              className="text-blue-600 cursor-pointer"
              onClick={() => navigate("/")}
            >
              ÄÄƒng nháº­p
            </span>
          </p>
        </div>

        {message && (
          <div
            className={`mb-4 px-4 py-3 rounded-lg text-white font-medium shadow transition-all duration-300 ${
              messageType === "success" ? "bg-green-500" : "bg-red-500"
            }`}
          >
            {message}
          </div>
        )}

        <form onSubmit={registerUser} className="space-y-4">
          <div>
            <label className="block mb-1">Há» tÃªn</label>
            <input
              value={name}
              onChange={(e) => setName(e.target.value)}
              placeholder="Há» tÃªn"
              type="text"
              className="w-full px-4 py-3 border rounded-lg"
            />
          </div>

          <div>
            <label className="block mb-1">Email</label>
            <input
              value={email}
